		"text": "#올댓뮤직\n⠀\n안녕하세요 올댓뮤직입니다. \n2월 5일 예정이던 올댓뮤직 공개녹화는\n신종 코로나 바이러스 확산 방지와\n관객 여러분의 안전을 위해 비공개 녹화로\n변경되었음을 알려드립니다.\n⠀\n또한 많은 신청자분들의 아쉬움과 요청을 반영해\n2월 5일 녹화는 실시간 생중계가 진행될 예정입니다. https://t.co/pkGznZyRZm"
